import React from "react";

const Clock = ({ timerDays, timerHours, timerMinutes, timerSeconds }) => {
  return (
  
     
          <div className="clock">
              <span>{timerDays}D:</span>
            
           
              <p>{timerHours}</p>
              <small>Hours</small>
           
            <span>:</span>
           
              <p>{timerMinutes}</p>
              <small>Minutes</small>
     
            <span>:</span>
       
              <p>{timerSeconds}</p>
              <small>Seconds</small>
           
          </div>
       
  
  );
};



export default Clock;
